set termout off
set serverout on
spool nonco_create.sql
declare
  l_need_drop int;
begin
   if user != 'CO' then
      dbms_output.put_line('pro |');
      dbms_output.put_line('pro | The new/replaced CO schema will be created now.');
      dbms_output.put_line('pro | ');
      dbms_output.put_line('pro | Note down this password for the CO schema. You will need it to connect');
      dbms_output.put_line('pro |');
      dbms_output.put_line('pro | Password (case-sensitive): &&pass');
      dbms_output.put_line('pro |');
      dbms_output.put_line('pro | The script will exit on any error encountered, because it should run');
      dbms_output.put_line('pro | to completion with no errors at all');
      dbms_output.put_line('pro | ');
      dbms_output.put_line('accept dummy prompt ''Press Enter to start''');

      select count(*)
      into   l_need_drop
      from   all_users
      where  username = 'CO';
      
      if l_need_drop > 0 then
        dbms_output.put_line('DROP USER CO CASCADE;');
      end if;
      dbms_output.put_line('CREATE USER CO IDENTIFIED BY &&pass;');
      dbms_output.put_line('ALTER USER CO DEFAULT TABLESPACE &&default_ts QUOTA UNLIMITED ON &&default_ts;');
      dbms_output.put_line('ALTER USER CO TEMPORARY TABLESPACE &&temp_ts;');
      dbms_output.put_line('grant CREATE SESSION to CO;');
      dbms_output.put_line('grant ALTER SESSION to CO;');
      dbms_output.put_line('grant CREATE TABLE to CO;');
      dbms_output.put_line('grant CREATE VIEW to CO;');
      dbms_output.put_line('grant CREATE SEQUENCE to CO;');
      dbms_output.put_line('grant CREATE PROCEDURE to CO;');
      dbms_output.put_line('grant CREATE TRIGGER to CO;');
      dbms_output.put_line('grant CREATE TYPE to CO;');
      dbms_output.put_line('alter session set current_schema = CO;');
   else      
      dbms_output.put_line('pro |');
      dbms_output.put_line('pro | The existing CO objects will now be dropped and the fresh objects created');
      dbms_output.put_line('pro | ');
      dbms_output.put_line('pro | The script will exit on any error encountered, because it should run');
      dbms_output.put_line('pro | to completion with no errors at all');
      dbms_output.put_line('pro | ');
      dbms_output.put_line('accept dummy prompt ''Press Enter to start''');
   end if;    
end;
/
spool off
set termout on
@nonco_create.sql

whenever sqlerror exit
set serverout on
declare
  l_cnt int;
begin
  if user = 'CO' then
    for iter in 1 .. 10 loop
      for i in ( select object_type, object_name
                 from   user_objects
                 order by decode(mod(iter,2),0,-1,1)*object_id
               )
      loop
        begin
          execute immediate 'drop '||i.object_type||' '||i.object_name||case when i.object_type = 'TABLE' then ' cascade constraints purge' end;
        exception
          when others then null;
        end;
      end loop;
      select count(*) 
      into   l_cnt
      from   user_objects;
      exit when l_cnt = 0;
    end loop;
    
    if l_cnt > 0 then
       dbms_output.put_line('---------------------------------------------------------');
       dbms_output.put_line('ERROR TEXT:');
       dbms_output.put_line('Something went wrong dropping the objects - it could be  ');
       dbms_output.put_line('that someone has an uncomitted transaction on one of the '); 
       dbms_output.put_line('tables which means we cannot drop it.'); 
       dbms_output.put_line('Please check on this and then re-run the install.');
       dbms_output.put_line('---------------------------------------------------------');
       raise_application_error(-20000,'Script exiting with error');
    end if;
  end if;
end;
/
whenever sqlerror exit


